import React from 'react';
import Sidebar from './Sidebar';
import '../styles/MainBodyStyles.css';

function MainBody({ selectedLink }) {
  return (
    <div>
      {selectedLink === 'form' && <Form />}
      {selectedLink === 'table' && <Table />}
    </div>
  );
}

export default MainBody;
